import React from "react";
import NavBarItem from "./NavBarItem";

const NAVBAR = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const NavBar = () => {
  return (
    <div>
      <h2>Booking Website</h2>
      <button>Regiter</button>
      <button>Login</button>
      {NAVBAR.map((item) => (
        <NavBarItem NavBarItem={NAVBAR} />
      ))}
    </div>
  );
};

export default NavBar;
